</mark>
 ) by RFP , so that the blood lend of P62158 decreases when RFP is administered concurrently . We connected an electrochemical detector to a high-performance liquid chromatograph ( HPLC ) for simple , rapid , easy measurement of blood concentrations of RFP and P62158 . Using samples of patient serum , normal serum , and reference standards , we compared HPLC by an external laboratory and the results of LC / MS / MS analysis with those of this new assay . A strong correlation was seen between our HPLC results and those of the external laboratory in RFP levels ( r = 0.975 , p &lt; 0.01 ) . A strong correlation was also seen between results we obtained for P62158 with the electrochemical detector in this assay and values measured by LC / MS / MS analysis ( r = 0.995 , p &lt; 0.01 ) . Our method enabled simple , rapid measurement of RFP and P62158 by connecting the HPLC and electrochemical detector in tandem . This system was used to modulate dosage during combined therapy with RFP and P62158 . The therapeutic effect for nontuberculous mycobacteriosis is expected to improve , and our HPLC is expected to be useful for simple , rapid , easy measurement of blood concentrations .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">Beneficial vasoactive endothelial effects of fluvastatin : focus on prostacyclin and nitric oxide . Statins are believed to exert beneficial effects against cardiovascular disease beyond correction of dyslipidemia . There are however still very sparse data on how individual statins interact with the production of vasoactive eicosanoids and nitric oxide ( NO ) in human vascular endothelial cells . Here we have determined how fluvastatin affects the mRNA expression of genes associated with vascular reactivity as well as the formation of two major vasodilators , prostacyclin (

 ) , the mRNA expression of

 and endothelial nitric oxide synthase (

 ) , and the production of

 and NO are significantly induced by fluvastatin . Also , strong rapid dilatation ex vivo was observed , with the equal contribution of

 and NO . Our findings in cell culture experiments and in isolated human arteries indicate that fluvastatin-evoked endothelium-derived vasodilator production may confer protection of the endothelial cells via both acute and long-term effects of fluvastatin treatment . If these effects take place in vivo , we suggest a protective pleiotropic role of fluvastatin on the cardiovascular system , particularly at the level of the vascular endothelium , to ameliorate the process of atherogenesis and in the acute manner to reduce vascular tone .</div>

<h2 style="margin: 0">8</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Augmentation of methamphetamine-induced behaviors in transgenic mice lacking the trace amine-associated receptor 1 . The trace amine-associated receptor 1 ( Q96RJ0 ) is a G protein-coupled receptor that is functionally activated by amphetamine-based psychostimulants , including amphetamine , methamphetamine and DB01454 . Previous studies have shown that in transgenic mice lacking the Q96RJ0 gene ( Q96RJ0 knockout ; KO ) a single injection of amphetamine can produce enhanced behavioral responses compared to responses evoked in wild-type ( WT ) mice . Further , the psychostimulant effects of cocaine can be diminished by selective activation of Q96RJ0 . These findings suggest that Q96RJ0 might be implicated in the rewarding properties of psychostimulants . To investigate the role of Q96RJ0 in the rewarding effects of drugs of abuse , the psychomotor stimulating effects of amphetamine and methamphetamine and the conditioned rewarding effects of methamphetamine and morphine were compared between WT and Q96RJ0 KO mice . In locomotor activity studies , both single and repeated exposure to 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB01576
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 or methamphetamine generated significantly higher levels of total distance traveled in Q96RJ0 KO mice compared to WT mice . In conditioned place preference ( CPP ) studies , Q96RJ0 KO mice acquired methamphetamine-induced CPP earlier than WT mice and retained CPP longer during extinction training . In morphine-induced CPP , both WT and KO genotypes displayed similar levels of CPP . Results from locomotor activity studies suggest that Q96RJ0 may have a modulatory role in the behavioral sensitization to amphetamine-based psychostimulants . That methamphetamine-but not morphine-induced CPP was augmented in Q96RJ0 KO mice suggests a selective role of Q96RJ0 in the conditioned reinforcing effects of methamphetamine . Collectively , these findings provide support for a regulatory role of Q96RJ0 in methamphetamine signaling .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">Inhibition of myoblast migration by prostacyclin is associated with enhanced cell fusion . Satellite cells are stem cells that are critical for the formation and growth of skeletal muscle during myogenesis . To differentiate and fuse , proliferating satellite cells or myoblasts must migrate and establish stable cell-cell contacts . However , the factors that regulate myoblast migration and fusion are not understood completely . We have identified 
<mark class="entity" style="background: linear-gradient(90deg, #003300, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 as a novel regulator of myogenesis in vitro .

</mark>
 is a member of the family of prostaglandins ( PG ) , autocrine / paracrine signaling molecules synthesized via the cyclooxygenase - 1 and - 2 pathways . Primary mouse muscle cells both secrete 
<mark class="entity" style="background: linear-gradient(90deg, #003300, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 and express the 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 , IP , at various stages of myogenesis . Using genetic and pharmacological approaches , we show that 
<mark class="entity" style="background: linear-gradient(90deg, #003300, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 is a negative regulator of myoblast migration that also enhances cell fusion . Thus , 
<mark class="entity" style="background: linear-gradient(90deg, #003300, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 may act as a &quot; brake &quot; on migrating cells to facilitate cell-cell contact and fusion . Together , our results highlight the importance of the balance between positive and negative regulators in cell migration and myogenesis . This work may have implications for migration of other populations of adult stem cells and / or cells that undergo fusion .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">DB02546 and bortezomib synergistically cause ubiquitinated protein accumulation in prostate cancer cells . PURPOSE : Protein ubiquitination is a novel strategy used to treat malignancies . We investigated whether the histone deacetylase inhibitor vorinostat ( Cayman Chemical , Ann Arbor , Michigan ) and the proteasome inhibitor bortezomib ( LC Laboratories , Woburn , Massachusetts ) would synergistically cause the accumulation of ubiquitinated proteins in prostate cancer cells . MATERIALS AND METHODS : LNCaP , PC - 3 and DU 145 cells ( ATCC  ) were treated with vorinostat and / or bortezomib . Cell viability and induction of apoptosis were assessed . In vivo efficacy was evaluated in a murine subcutaneous tumor model using PC - 3 cells . The influence of androgen receptor expression on bortezomib efficacy was examined using RNA interference . Changes in the expression of ubiquitinated proteins , cell cycle associated proteins and acetylated histone were evaluated . RESULTS : 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P10275
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 expression seemed to decrease bortezomib activity . PC - 3 and DU 145 cells were more susceptible to bortezomib than LNCaP cells and the silencing of androgen receptor expression in LNCaP cells enhanced bortezomib activity . DB02546 and bortezomib synergistically induced apoptosis , inhibited prostate cancer cell growth and suppressed tumor growth in a murine xenograft model . The combination decreased cyclin D1 and cyclin-dependent kinase 4 expression , and increased 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P38936
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 expression . The combination synergistically caused the accumulation of ubiquitinated proteins and histone acetylation . This histone acetylation was a consequence of the accumulation of ubiquitinated proteins . CONCLUSIONS : DB02546 and bortezomib inhibit the growth of prostate cancer cells synergistically by causing ubiquitinated proteins to accumulate in cells . The current study provides a framework for testing the combination in patients with advanced prostate cancer .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">Strategies for the analysis of oncogene overexpression . Studies of the neu oncogene in breast carcinoma . The development of a consistent strategy for the analysis of oncogene expression at the cellular level is essential for understanding the roles of these genes in the development and progression of human neoplasia . Detection of the neu oncogene products in breast carcinoma was selected as a model for analysis of oncogene expression . Fifty-two primary human breast carcinomas were evaluated by quantitation of neu DNA amplification and mRNA expression and by localization of neu mRNA and protein ( p 185 ) at the cellular level by in situ hybridization ( ISH ) and immunohistochemistry ( IHC ) . The specificity and sensitivity of the molecular and immunologic probes for neu were established with the use of genetically engineered cell lines that overexpressed either neu or epidermal growth factor receptor ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ) . Twenty-nine percent of breast carcinomas demonstrated neu DNA amplification and mRNA overexpression , and there was close correlation between the level of neu mRNA expression and detection of neu gene products by ISH and IHC . Thirty-two percent of carcinomas demonstrated neu mRNA overexpression by ISH . The immunohistochemical method using Q96RJ0 monoclonal antibody for p185 was exquisitely sensitive in acetone-fixed frozen sections and provided an excellent approach for judging overexpression as confirmed by the various molecular analyses . All areas of nonmalignant breast epithelium stained weakly , and a wide range of staining intensity was observed in malignant breast epithelium , with 31 % of carcinomas judged to be p185 overexpressors . Heterogeneous expression of p185 was seen in some carcinomas . This study provides a strategic approach for the evaluation of oncogene expression in human tumors .</div>

 and p53 protein . While such agents have undergone extensive study in many solid tumor types , the additional importance of

 and p53 in restraining transcription of the AR gene within the prostate provides impetus for examining how loss of these two tumor suppressor proteins can facilitate transition of prostate cancers to CRPC . As will be reviewed in this article , restoration of

 and p53 functions are not only important in regard to shortterm cell cycle regulation and response to genomic stresses , but likely have direct implications for deregulation of the AR locus .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">[ Polarized light as an epigenetic factor in inhibition of inflammation ; a genome-wide expression analysis in recurrent respiratory diseases of children ] . Whole-body polarized light therapy has been primarily investigated in various clinical observations and in a few in vitro model systems . AIMS : In the present study , clinical and molecular effects of whole-body polarized light treatment on children suffering from recurrent respiratory infection were studied . METHODS : Incidence and duration of respiratory symptoms as well as the length of appropriate antibiotic therapy have been measured . Simultaneously , genome-wide gene expression pattern was examined by whole genome cDNA microarray in peripheral lymphocytes of children . RESULTS : Twenty of twenty five children showed a marked clinical improvement , while in five of twenty five had poor or no changes . Gene expression pattern of the peripheral lymphocytes of the patients was compared in favorable and poor responders . Lymphocytes of the children with a documented improved clinical response to polarized light therapy showed a decrease in the expression of chemokine genes , such as

 ,

 ,

 and in that of the tumor necrosis alpha ( TNF ) gene . On the contrary , a rapid elevation was found in the expression of gene encoding for

 . The ease with which DB00917 reverses the effects of

 ) receptor is the locus of biological action . Structure-activity studies demonstrated that the minimum structural requirements for binding to the platelet

<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 ) is among the most important nonsteroidal regulators of AR activity . In the absence of androgen ,

 causes activation of AR that is approximately 50 % of the maximal activity induced by androgen . At low concentrations of androgen , 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 and androgen synergistically activate AR . Nonsteroidal antiandrogens usually antagonize this activation , but they switch to an agonist effect in the presence of oncostatin M , an 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 , but long-term treatment renders the cells resistant to such inhibition and confers a growth advantage . Both

 and oncostatin M stimulate AR activity , but only oncostatin M is associated with strong acquisition of the agonist properties of nonsteroidal antiandrogens . It is hoped that continuing research on AR expression and function in prostate cancer will pave the way for new therapeutic strategies .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">Effects of inhaled prostacyclin analogue on chronic hypoxic pulmonary hypertension . Inhaled 
<mark class="entity" style="background: linear-gradient(90deg, #003300, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 has been reported to elicit pulmonary vasodilation , but whether it is also effective in treating chronic hypoxic pulmonary hypertension is still uncertain . We designed this study to address the in vivo effectiveness of inhaled DB05229 , a stable 
<mark class="entity" style="background: linear-gradient(90deg, #003300, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 analogue , on pulmonary vascular tone during hypoxic exposure in normoxic ( N ) and chronically hypoxic ( CH ) rats . Pulmonary vasodilation was observed by low-dose inhaled DB05229 in N rats , but not in CH rats . It was not until higher doses of DB05229 were given that pulmonary vasodilation was obtained in CH rats . When the agent was continuously administered by an intravascular route at the inhaled dose , it elicited no vasodilation in N rats . On the contrary , it elicited profound vasodilation in CH rats , although a concomitant systemic hypotension was observed . The 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 mRNA expression was unchanged in the lungs of CH rats compared with that of N rats . We conclude that low doses of aerosolized DB05229 may reduce pulmonary vascular tone in rats without preexisting lung diseases . In contrast , when hypoxic pulmonary hypertension is present , the threshold of DB05229 inhalation was elevated to provoke pulmonary vasodilation .</div>
